package Guvi_IP_OP;

import java.util.Scanner;

public class Guvi4_Ip_Op_ {
	/*
	 * Write a code to get the input in the given format and print the output in the
	 * given format
	 * 
	 * Input Description: First-line indicates two integers separated by space.
	 * Second-line indicates two integers separated by space. Third-line indicates
	 * two integers separated by space.
	 * 
	 * Output Description: Print the input in the same format.
	 * 
	 * Sample Input : 2 4 2 4 2 4 Sample Output : 2 4 2 4 2 4
	 */

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		Scanner sc = new Scanner(System.in);
		String oneline = sc.nextLine();
		String twoline = sc.nextLine();
		String thirdline = sc.nextLine();
		System.out.println(oneline);
		System.out.println(twoline);
		System.out.println(thirdline);
		sc.close();
	}

}
